// 
import React from 'react';
import './my_';

function MyMap() {
  return (
    <div className="my-map-container">
      <h1 className="my-map-heading">This is my page</h1>
      <div className="my-map-wrapper">
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3034.1003994988296!2d72.82455501513047!3d40.49516285878994!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x38bdae680551f8c1%3A0xee31f3f7356fc40!2sKyrgyz-Uzbek%20University!5e0!3m2!1sen!2skg!4v1680785124136!5m2!1sen!2skg"
          className="my-map-iframe"
          allowFullScreen={true}
          loading="lazy"
          referrerPolicy="no-referrer-when-downgrade"
        ></iframe>
        <div className="my-map-marker">
          <h5 className="my-map-marker-heading">Kyrgyz-Uzbek University</h5>
          <ul className="my-map-marker-list">
            <li>Weekdays: 10.00 - 23.00</li>
            <li>Saturday: 10.00 - 23.00</li>
            <li>Sunday: Closed</li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default MyMap;
